        "6.11. The Affiliate shall be exclusively responsible for the payment of any and all taxes, levies, fees, charges and any other money payable or due both locally and abroad (if any) to any tax authority, department or other competent entity by the Affiliate as a result of the commission generated under this Agreement. The Company shall in no manner whatsoever be held liable for any amounts unpaid but found to be due by the Affiliate and the Affiliate hereby indemnifies the Company in that regard.": "6.11. \u0110\u1EA1i l\xFD s\u1EBD ch\u1ECBu tr\xE1ch nhi\u1EC7m \u0111\u1ED9c quy\u1EC1n v\u1EC1 vi\u1EC7c thanh to\xE1n b\u1EA5t k\u1EF3 v\xE0 t\u1EA5t c\u1EA3 c\xE1c kho\u1EA3n thu\u1EBF, l\u1EC7 ph\xED, ph\xED, v\xE0 b\u1EA5t k\u1EF3 kho\u1EA3n ti\u1EC1n n\xE0o kh\xE1c ph\u1EA3i tr\u1EA3 ho\u1EB7c \u0111\u1EBFn h\u1EA1n \u1EDF c\u1EA3 trong n\u01B0\u1EDBc v\xE0 n\u01B0\u1EDBc ngo\xE0i (n\u1EBFu c\xF3) cho b\u1EA5t k\u1EF3 c\u01A1 quan thu\u1EBF, b\u1ED9 ph\u1EADn ho\u1EB7c \u0111\u01A1n v\u1ECB c\xF3 th\u1EA9m quy\u1EC1n n\xE0o kh\xE1c b\u1EDFi \u0110\u1EA1i l\xFD v\u1EDBi t\u01B0 c\xE1ch l\xE0 k\u1EBFt qu\u1EA3 c\u1EE7a kho\u1EA3n hoa h\u1ED3ng \u0111\u01B0\u1EE3c t\u1EA1o ra theo Th\u1ECFa thu\u1EADn n\xE0y. C\xF4ng ty s\u1EBD kh\xF4ng ch\u1ECBu b\u1EA5t k\u1EF3 tr\xE1ch nhi\u1EC7m ph\xE1p l\xFD n\xE0o \u0111\u1ED1i v\u1EDBi b\u1EA5t k\u1EF3 s\u1ED1 ti\u1EC1n n\xE0o ch\u01B0a \u0111\u01B0\u1EE3c thanh to\xE1n nh\u01B0ng \u0111\u01B0\u1EE3c \u0110\u1EA1i l\xFD ph\xE1t hi\u1EC7n l\xE0 \u0111\u1EBFn h\u1EA1n v\xE0 theo \u0111\xE2y \u0110\u1EA1i l\xFD s\u1EBD b\u1ED3i th\u01B0\u1EDDng cho C\xF4ng ty v\u1EC1 v\u1EA5n \u0111\u1EC1 \u0111\xF3.",
        '6.2. The commission shall be a percentage of the Game bet amount in accordance with what is set out in the commission structures for the particular product. The calculation is product specific and it is set out in every product-specific commission structure. (see "commission rules" for details)': '6.2. Hoa h\u1ED3ng s\u1EBD l\xE0 m\u1ED9t t\u1EF7 l\u1EC7 ph\u1EA7n tr\u0103m c\u1EE7a s\u1ED1 ti\u1EC1n \u0111\u1EB7t c\u01B0\u1EE3c Tr\xF2 ch\u01A1i ph\xF9 h\u1EE3p v\u1EDBi nh\u1EEFng g\xEC \u0111\u01B0\u1EE3c quy \u0111\u1ECBnh trong c\u1EA5u tr\xFAc hoa h\u1ED3ng cho s\u1EA3n ph\u1EA9m c\u1EE5 th\u1EC3. C\xE1ch t\xEDnh l\xE0 d\u1EF1a theo s\u1EA3n ph\u1EA9m c\u1EE5 th\u1EC3 v\xE0 n\xF3 \u0111\u01B0\u1EE3c \u0111\u1EB7t ra trong m\u1ED7i c\u1EA5u tr\xFAc hoa h\u1ED3ng c\u1EE7a t\u1EEBng s\u1EA3n ph\u1EA9m c\u1EE5 th\u1EC3. (xem "quy t\u1EAFc hoa h\u1ED3ng" \u0111\u1EC3 bi\u1EBFt th\xEAm chi ti\u1EBFt)',
        "6.3. Users can withdraw commissions from the agent system at any time. The commissions will be withdrawn into the platform wallet. Users can also withdraw the platform wallet to any address at any time. (you can check the Commission extraction in the agent system and view transaction records in the platform wallet).": "6.3. \u0110\u1EA1i l\xFD c\xF3 th\u1EC3 r\xFAt ti\u1EC1n hoa h\u1ED3ng t\u1EEB h\u1EC7 th\u1ED1ng \u0111\u1EA1i l\xFD b\u1EA5t c\u1EE9 l\xFAc n\xE0o. Ti\u1EC1n hoa h\u1ED3ng s\u1EBD \u0111\u01B0\u1EE3c r\xFAt v\xE0o v\xED c\u1EE7a \u0111\u1EA1i l\xFD tr\xEAn trang web. \u0110\u1EA1i l\xFD c\u0169ng c\xF3 th\u1EC3 r\xFAt ti\u1EC1n trong v\xED \u0111\u1EBFn b\u1EA5t k\u1EF3 \u0111\u1ECBa ch\u1EC9 n\xE0o v\xE0o b\u1EA5t k\u1EF3 l\xFAc n\xE0o. (b\u1EA1n c\xF3 th\u1EC3 ki\u1EC3m tra vi\u1EC7c tr\xEDch Hoa h\u1ED3ng trong h\u1EC7 th\u1ED1ng \u0111\u1EA1i l\xFD v\xE0 xem l\u1ECBch s\u1EED giao d\u1ECBch trong v\xED c\u1EE7a m\xECnh).",
        "6.4. The commissions will be collected in digital currency and will only be received on the platform wallet.When applying for Withdraw, you must submit the correct wallet address on the \u201CWithdraw\u201D page.If there is an error in calculating the commission, the company has the right to amend the amount at any time and immediately settle the underpaid difference to the agent or recover the overpaid balance from the agent.": "6.4. Ti\u1EC1n hoa h\u1ED3ng s\u1EBD \u0111\u01B0\u1EE3c thu b\u1EB1ng ti\u1EC1n k\u1EF9 thu\u1EADt s\u1ED1 v\xE0 ch\u1EC9 c\xF3 th\u1EC3 nh\u1EADn \u0111\u01B0\u1EE3c tr\xEAn v\xED c\u1EE7a m\xECnh. Khi \u0111\u0103ng k\xFD R\xFAt ti\u1EC1n, b\u1EA1n ph\u1EA3i g\u1EEDi \u0111\u1ECBa ch\u1EC9 v\xED ch\xEDnh x\xE1c tr\xEAn trang \u201CR\xFAt ti\u1EC1n\u201D. N\u1EBFu x\u1EA3y ra l\u1ED7i trong vi\u1EC7c t\xEDnh to\xE1n hoa h\u1ED3ng, c\xF4ng ty c\xF3 quy\u1EC1n ch\u1EC9nh s\u1EEDa s\u1ED1 ti\u1EC1n b\u1EA5t k\u1EF3 l\xFAc n\xE0o v\xE0 thanh to\xE1n ngay ph\u1EA7n ch\xEAnh l\u1EC7ch ch\u01B0a thanh to\xE1n cho \u0111\u1EA1i l\xFD ho\u1EB7c thu h\u1ED3i s\u1ED1 d\u01B0 tr\u1EA3 th\u1EEBa t\u1EEB \u0111\u1EA1i l\xFD.",
        "6.5. Agent Withdraw commission by the Affiliate shall be deemed to be full and the final settlement of the balance due for the period indicated.": "6.5. Hoa h\u1ED3ng R\xFAt ti\u1EC1n c\u1EE7a \u0110\u1EA1i l\xFD s\u1EBD \u0111\u01B0\u1EE3c coi l\xE0 \u0111\xE3 \u0111\u1EA7y \u0111\u1EE7 v\xE0 l\xE0 kho\u1EA3n thanh to\xE1n cu\u1ED1i c\xF9ng c\u1EE7a s\u1ED1 d\u01B0 c\xF3 th\u1EDDi h\u1EA1n trong kho\u1EA3ng th\u1EDDi gian \u0111\u01B0\u1EE3c ch\u1EC9 \u0111\u1ECBnh.",
