        "6.7. May delay the Withdraw request through the agent for up to sixty (60) days, while it investigates and verifies that the relevant transactions comply with the provisions of the Terms.": "6.7. Y\xEAu c\u1EA7u R\xFAt ti\u1EC1n th\u1EF1c hi\u1EC7n th\xF4ng qua \u0111\u1EA1i l\xFD c\xF3 th\u1EC3 tr\xEC ho\xE3n trong t\u1ED1i \u0111a s\xE1u m\u01B0\u01A1i (60) ng\xE0y, trong khi \u0111ang \u0111i\u1EC1u tra v\xE0 x\xE1c minh r\u1EB1ng c\xE1c giao d\u1ECBch c\xF3 li\xEAn quan \u0111\u1EC1u tu\xE2n th\u1EE7 c\xE1c quy \u0111\u1ECBnh c\u1EE7a \u0110i\u1EC1u kho\u1EA3n.",
