        "6.9. The Affiliate agrees to return all commissions received based on fraudulent or falsified transactions, plus all costs for legal causes or actions that may be brought against the Affiliate to the fullest extent of the law.": "6.9. \u0110\u1EA1i l\xFD \u0111\u1ED3ng \xFD tr\u1EA3 l\u1EA1i t\u1EA5t c\u1EA3 hoa h\u1ED3ng nh\u1EADn \u0111\u01B0\u1EE3c d\u1EF1a tr\xEAn c\xE1c giao d\u1ECBch gian l\u1EADn ho\u1EB7c gi\u1EA3 m\u1EA1o, c\u1ED9ng v\u1EDBi t\u1EA5t c\u1EA3 c\xE1c chi ph\xED cho c\xE1c ph\xE1t sinh ph\xE1p l\xFD ho\u1EB7c h\xE0nh \u0111\u1ED9ng c\xF3 th\u1EC3 \u0111\u01B0\u1EE3c \u0111\u01B0a ra ch\u1ED1ng l\u1EA1i \u0110\u1EA1i l\xFD trong ph\u1EA1m vi t\u1ED1i \u0111a c\u1EE7a ph\xE1p lu\u1EADt.",
